

// var cannot be used as a Generic
// type

public class VarDemo2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		var<var> al = new ArrayList<>();
        
        // add elements
		al.add(10);
		al.add(20);
		al.add(30);
      
      // print the list
		System.out.println(al);
	}

}
